   "source": [
    "trends <- gtrends(keyword = c(\"bitcoin pesos\", \"bitcoin dolar\", \"dolar blue\", \"plazo fijo\"),\n",
    "                                            geo = \"AR\",\n",
    "                                            time = \"all\",\n",
    "                                            onlyInterest = TRUE) %>%\n",
    "                                              .$interest_over_time %>%\n",
    "                                              mutate_at(\"hits\", ~ifelse(. == \"<1\", 0.5, .)) %>% # replace with 0.5\n",
    "                                              mutate_at(\"hits\", ~as.numeric(.))"
   ]
